    def getProxy(self):

        proxy = random.choice(self.all_proxies)

        proxyHandler = f'http://{proxy["username"]}:{proxy["password"]}@{proxy["proxy_address"]}:{proxy["ports"]["http"]}'

        return {"https": proxyHandler, "http": proxyHandler}

    def make_request(self, data):
        while True:
            try:
                # proxies = self.getProxy()
                res = requests.post(
                    self.url, headers=self.headers,
                    cookies=self.cookies,
                    data=data)
                print(res.status_code)
                print("---------------")
                soup = BeautifulSoup(res.content, 'lxml')
                lastpages_text = self.helper.get_text_from_tag(soup.find(
                    'div', {'class': 'medium-6 columns text-center'}).find('p')).split("of")[-1].strip()
                if lastpages_text:
                    return soup
            except Exception as e:
                print(e, 'make request')
                pass

    def param(self, tag, text):

        value = text.split(tag)[1].split('|')[1]
        return value

